  \"Migratory bird population of the National Petroleum Reserve-Alaska (NPR-A), 1977\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:01:42.571989\",\n\t\"name\": \"migratory-bird-population-of-the-national-petroleum-reserve-alaska-npr-a-1977\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Four hundred and twenty square miles of
  aerial surveys were flown over 36,300 sq mi (94,000 sq km) of NPR-A during June
  through September. Twelve categories of migratory birds are represented which include:
  loons, swans, geese, dabbling ducks, diving ducks, raptors, ptarmigan, shorebirds,
  jaegers, gulls, terns and passerines. Distribution of migratory birds are plotted
  by density estimates. Densities are summarized by bird categories and season of
  use. Recommendations are made for methods of collecting more accurate field information
  for 1978. Extending the data gathering period for estimates of complete use of NPR-A
  by all migratory birds is also suggested.\",\n\t\"license_title\": \"License Not
